import Card from './Card';

export default function Cards({characters}) {
   return <div>{characters.map(char => (
      <Card
         key = {Id}
         name = {char.name}
         status = {char.status}
         species = {char.species}
         gender = {char.gender}
         origin = {char.origin}
         image = {char.image}
         onClose = {char.onClose}
      />
      ))
   }</div>;
}
